import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import './index.css';
import './components/styling.css';
import SignUpForm from './pages/SignUpForm';
import SignInForm from './pages/SignInForm';
import Event from './components/eventPage/event';
import App from './App';
import img from './assets/img/ins.jpg';
import {getClubs} from "../datafolder/clubData";

const clubs = getClubs();

const routes = (
    <Switch>
      <Route exact path="/" component={App}/>
      <Route exact path="/SignIn" component={SignInForm}/>
      <Route exact path="/SignUp" component={SignUpForm}/>
      <Route exact path="/club" component={() => <Event title={`my title`} image= {img} />}/>
     
      {
                clubs.map(club=>{
                
                return (<Route exact path={"/"+club.title}
                 component={() => <Event title={club.title} image= {club.image} />}/>)
              })
            }
            
            
      </Switch>
    
);

export default routes;
